import * as React from 'react'
import { DatePicker } from 'chakra-ui-date-input'
import { Center } from '@chakra-ui/react'

export interface ISimpleComponentProps {}

export default function SimpleComponent(props: ISimpleComponentProps) {
  return (
    <Box h="100vh">
 <Center w='420px' h='100px' color='white'>
      <DatePicker
        placeholder='Date picker placeholder'
        name='date'
        onChange={(date: any) => console.log(date)}
      />
    </Center>
    </Box>

  )
}
